




import base64
import os
import vertexai
from vertexai.preview.generative_models import GenerativeModel, Part, SafetySetting
from google.cloud import aiplatform

import importlib.util
import sys

# For illustrative purposes.
name = 'itertools'

if name in sys.modules:
    print(f"{name!r} already in sys.modules")
elif (spec := importlib.util.find_spec(name)) is not None:
    # If you chose to perform the actual import ...
    module = importlib.util.module_from_spec(spec)
    sys.modules[name] = module
    spec.loader.exec_module(module)
    print(f"{name!r} has been imported")
else:
    print(f"can't find the {name!r} module")


def generate():
    vertexai.init(api_key=os.environ.get("GOOGLE_CLOUD_API_KEY"))
    model = GenerativeModel(
        "gemini-1.5-flash-002",
        system_instruction=[si_text1]
    )
    responses = model.generate_content(
        [text1, document1],
        generation_config=generation_config,
        safety_settings=safety_settings,
        stream=True,
    )

    for response in responses:
        print(response.text, end="")

text1 = """You are a document entity extraction specialist. Given a document, your task is to extract the text value of the following entities:
{
\"Issuer\": [
{
\"Guarantor\": \"\",
\"Underwriter\": \"\",
\"Underwriter Contact\": \"\",
\"Issuer Contact\": \"\",
\"Issuer\": \"\",
}
],
\"Security\": [
{
\"Security Type\": \"\",
\"Maturity Date\": \"\",
\"Maturity Date\": \"\",
}
],
\"Others\": [
{
\"Security Type\": \"\"
}
]

}

- The JSON schema must be followed during the extraction.
- Duplicates can be removed
- The values must only include text strings found in the document.
- Generate null for missing entities.
- Entities not included in the JSON but relevant to entities in the json must be extracted in a key labelled under \"Others\""""
document1 = Part.from_data(
    mime_type="application/pdf",
    data=base64.b64decode(""""""),
)
si_text1 = """As an expert in document entity extraction, you parse documents to identify and organize specific entities from diverse sources into structured formats, following detailed guidelines for clarity and completeness."""

generation_config = {
    "max_output_tokens": 8192,
    "temperature": 0.4,
    "top_p": 0.95,
}

safety_settings = [
    SafetySetting(
        category=SafetySetting.HarmCategory.HARM_CATEGORY_HATE_SPEECH,
        threshold=SafetySetting.HarmBlockThreshold.OFF
    ),
    SafetySetting(
        category=SafetySetting.HarmCategory.HARM_CATEGORY_DANGEROUS_CONTENT,
        threshold=SafetySetting.HarmBlockThreshold.OFF
    ),
    SafetySetting(
        category=SafetySetting.HarmCategory.HARM_CATEGORY_SEXUALLY_EXPLICIT,
        threshold=SafetySetting.HarmBlockThreshold.OFF
    ),
    SafetySetting(
        category=SafetySetting.HarmCategory.HARM_CATEGORY_HARASSMENT,
        threshold=SafetySetting.HarmBlockThreshold.OFF
    ),
]

generate()